package com.tuisitang.modules.shop.entity;import java.io.Serializable;import java.util.Date;import net.jeeshop.core.dao.page.PagerModel;/**     * @{#} ProductHitTrace.java *  * 产品点击跟踪记录 *  * <p>Copyright: Copyright(c) 2013 </p>  * <p>Company: TST</p> * @version 1.0 * @author <a href="mailto:paninxb@gmail.com">panin</a>    */public class ProductHitTrace extends PagerModel<ProductHitTrace> implements Serializable {	/**	 * 	 */	private static final long serialVersionUID = 1L;		private Long id;	private Long productId;	private String productName;	private String sessionId;	private Long accountId;	private Date hitTime;	public ProductHitTrace() {		super();	}	public ProductHitTrace(Long productId, String productName, String sessionId, Long accountId) {		super();		this.productId = productId;		this.productName = productName;		this.sessionId = sessionId;		this.accountId = accountId;	}	public Long getId() {		return id;	}	public void setId(Long id) {		this.id = id;	}	public Long getProductId() {		return productId;	}	public void setProductId(Long productId) {		this.productId = productId;	}	public String getProductName() {		return productName;	}	public void setProductName(String productName) {		this.productName = productName;	}	public String getSessionId() {		return sessionId;	}	public void setSessionId(String sessionId) {		this.sessionId = sessionId;	}	public Long getAccountId() {		return accountId;	}	public void setAccountId(Long accountId) {		this.accountId = accountId;	}	public Date getHitTime() {		return hitTime;	}	public void setHitTime(Date hitTime) {		this.hitTime = hitTime;	}}